import React from 'react';
import { IonItem, IonLabel, IonDatetime,IonInput,IonList } from '@ionic/react';
import { ItemProps } from './ItemProps';
import {text} from "ionicons/icons";

interface ItemPropsExt extends ItemProps {
    onEdit: (id?: string) => void;
}

const Item: React.FC<ItemPropsExt> = ({ id, data,ora,serv,nrPer,num,lib, onEdit }) => {
    return (
        <IonList>
            <IonItem onClick={() => onEdit(id)}>
                <IonLabel>Data(LL/ZZ/AAAA)-> <IonDatetime >{data}</IonDatetime></IonLabel><br />
                <IonLabel>Ora(HH:MM)-> <IonDatetime displayFormat="HH:mm">{ora}</IonDatetime></IonLabel><br />
                <IonLabel>Serviciul-> {serv}</IonLabel><br />
                <IonLabel>Numarul persoanelor-> <IonInput value = {text}>{nrPer}</IonInput></IonLabel><br />
                <IonLabel>Nume-> {num}</IonLabel><br />
                <IonLabel>Liber-> {lib}</IonLabel><br />
            </IonItem>
        </IonList>
    );
};

export default Item;
